parameters.query:
=query {
	orders(first: 10, query: "date:2023-06-01") {
		edges {
			node {
				name
				createdAt
				currentTotalPriceSet {
					shopMoney {
						amount
					}
				}
				customerJourneySummary {
					daysToConversion
					moments(first: 5) {
						edges {
							node {
								... on CustomerVisit {
									landingPage
									utmParameters {
										source
										campaign
										term
										content
										medium
									}
								}
							}
						}
					}
				}
			}
		}
	}
}
